    "2016-03-07T23:34:43.588877",nt"name": "reunifications-by-sfy-dcf-office-race-and-length-of-stay",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset contains aggregate data concerning
    the number of children that exited DCF care to be Reunified with a parent/guardian
    from whom they had been removed.  These figures are broken out by the DCF Region
    and Office responsible for the child's care, by their Age Group, and by whether
    they had been Reunified within 12 months of their entry to care or not.  It would
    be appropriate to roll up the data from all variables across multiple time periods,
    as they represent specific events in the lives of these children.  Please note that
    these figures do not represent unique children, and so should not be used as the
    basis for creating a rate based on the child population of the state.  These data
    form the basis of measurement for the Juan F. Consent Decree Exit Plan Outcome #7:
    Reunification Within 12 Months, although those figures are reported to the DCF Court
    Monitor on a quarterly rather than annual schedule.",nt"license_title": "License
